import React from 'react';
import './App.css';
import Hero from './components/Hero';

function App() {
  return (
    <div className="font-sans">
      <Hero />

      {/* Placeholder sections for now */}
      <section id="about" className="min-h-screen bg-white p-8">
        <h2 className="text-4xl font-bold text-tech-blue mb-8">About Me</h2>
        <p>About section coming soon...</p>
      </section>

      <section id="skills" className="min-h-screen bg-tech-blue p-8">
        <h2 className="text-4xl font-bold text-white mb-8">My Skills</h2>
        <p className="text-white">Skills section coming soon...</p>
      </section>

      <section id="contact" className="min-h-screen bg-tech-navy p-8">
        <h2 className="text-4xl font-bold text-tech-cyan mb-8">Contact Me</h2>
        <p className="text-white">Contact section coming soon...</p>
      </section>
    </div>
  );
}

export default App;
